import { BrowserRouter as Router,Route,Routes } from "react-router-dom";
import Home from "./Pages/Home";
import About from "./Pages/About";
const App=()=>{
    return(
        <>
         <Router>
             <Routes>
                <Route path="/" Component={Home}></Route>
                <Route path="/About" Component={About}></Route>
             </Routes>
         </Router>
        </>
    )
}
export default App;
